likes.fullText:
Future CSS Tip! 🔮

Scroll-linked animation powered by CSS 🤯

.search{ view-timeline-name: --bar; }
.logo{
  animation: fade;
  animation-timeline: --bar;
  animation-delay: exit -100%;
  animation-end-delay: exit -50%;
}
keyframes fade { to { opacity: 0; }}

Demo link below! 👇 https://t.co/6Bwh7ye2Qo

